import React from "react";

const Product = () => {
  const ProductList = [
    { id: 1, Image: "", Name: "Carrot", Weight: "250gm", Price: "Rs.40" },
    { id: 2, Image: "", Name: "Cucumber", Weight: "250gm", Price: "Rs.30" },
    { id: 3, Image: "", Name: "Bhendi", Weight: "250gm", Price: "Rs.40" },
    { id: 4, Image: "", Name: "Sweet Corn", Weight: "1 No", Price: "Rs.20" },
  ];
  return (
    <div>
      <h1>Product</h1>
    </div>
  );
};

export default Product;
